SECTION XX 
MARCHANDISES  ET PRODUITS  DIVERS  
CHAPITRE  94 
MEUBLES  ; MOBILIER  MEDICO -CHIRURGICAL;  ARTICLES  DE LITERIE  
ET SIMILAIRES ;  LUMINAIRES  ET APPAREILS  D'ECLAIRAGE  NON  DENOMMES  NI COMPRIS 
AILLEURS ; LAMPES -RECLAMES, ENSEIGNES LUMINEUSES ; PLAQUES INDICATRICES 
LUMINEUSES ET ARTICLES SIMILAIRES ;CONSTRUCTIONS PREFABRIQUEES  
Notes.  
1.- Le présent  Chapitre  ne comprend  pas : 
a)les matelas,  oreillers  et coussins  à gonfler  à l'air (pneumatiques)  ou à l'eau,  des Chapitres  39, 40 ou 63;
b)les miroirs  reposant  sur le sol (psychés,  par exemple)  (n° 70.09)  ;
c)les articles  du Chapitre  71 ;
d)les parties  et fournitures  d'emploi  général,  au sens  de la Note  2 de la Section  XV, en métaux  communs
(Section XV), les articles similaires en matières plastiques (Chapitre 39) et les coffres -forts du n° 83.03 ;
e)les meubles, même présentés non équipés, constituant des parties spécifiques d'appareils pour la production
du froid du n° 84.18; les meub les spécialement concus pour machines à coudre, au sens du n° 84.52;
f)les sources  lumineuses  et appareils  d'éclairage,  et leurs  parties  du Chapitre  85 ;
g)les meubles  constituant  des parties  spécifiques  d'appareils  des n°s 85.18  (n° 85.18),  85.19  ou 85.21  (n°
85.

18),  85.19  ou 85.21  (n°
85.22) ou des n°s 85.25 à 85.28 (n° 85.29) ;
h)les articles  du n° 87.14  ;
ij) les fauteuils de dentistes incorporant des appareils pour l'art dentaire du n° 90.18 ainsi que les crachoirs pour
cabinets dentaires (n° 90.18) ;  
k)les articles  du Chapitre  91 (cages  et cabinets  d'appareils  d'horlogerie,  par exemple)  ;
l)les meubles et luminaires et appareils d'éclairage ayant le caractère de jouets (n° 95.03), les billards de toutes
sortes et les meubles de jeux du n° 95.04, ainsi que les tables pour jeux de prestidigitation et les articles de
décoration (à l'exclusion des guirlandes électriques), tels que lampions, lanternes vénitiennes (n° 95.05).  
m)les monopodes,  les bipieds,  les trépieds  et articles  similaires  du n° 96.20.
2.- Les articles  (autres  que les parties)  visés  dans  les n°s 94.01  à 94.03  doivent  être conçus  pour se poser  sur le sol. 
Restent  toutefois compris dans  ces positions,  même s'ils  sont conçus  pour être suspendus, fixés  au mur  ou 
posés les uns sur les autres :  
a)les armoires,  les bibliothèques,  les étagères  et les meubles  à éléments  complémentaires  ;
b)les sièges  et lits.
